import Navbar from '../../UI/Navbar-old';

import './DAOffice.css';

class MissionStatement extends Component {
    render () {
        return (
            <Fragment>
                <div className="home-wrapper">
                <div className="wrapper">
                    <Navbar></Navbar>
                    <div className="container">
                        <div className="content-wrapper-no-flex">
                            <div className="
                                    align-self-center
                                    font-bold text-xl font-display 
                                    border-b-2 border-mustard w-max">
                                   Our Mission
                                </div>
                            <p className="mt-4">This is an example of the type of data we can upload</p>â€‹
                        </div>
                    </div>
                </div>
                </div>
            </Fragment>
        )
    }
}

export default MissionStatement;
